result:
.bottomBtn{
	display: grid;
	grid-template-columns: 50% 50%;
	grid-template-rows: auto;
}
.mobile-grid{
	display: grid;
	grid-template-columns: 48% 48%;
	grid-template-rows: auto auto;
	grid-gap: 10px;
}

.mobile-grid-one{
	display: grid;
	grid-template-columns: 48% 48%;
	grid-template-rows: auto;
	grid-gap: 10px;
}

.xy-select {
	width: 100px;
	border: 1px solid;
	border-radius: 3px;
	background: none;
	padding: 4px;
}

.xy-select:focus {
	outline: 0;
	border: 1px solid #4caf50;
	border-radius: 5px;
}

.xy-options {
	padding: 5px 3px;
}

.xy-options:hover {
	background: #4caf50;
}

.nameStyle {
	outline: 0;
	max-width: 200px;
	padding: 3px 3px 3px 5px;
	border-radius: 3px;
	border: 1px solid;
}

.fade-enter-active,
.fade-leave-active {
	transition: opacity .5s
}

.fade-enter,
.fade-leave-active {
	opacity: 0
}
